import COUNTRIES_DATA from './../../../data.json'

import CountriesListNavigation from './CountriesListNavigation';

export default function CountriesList() {
	return (
		<div className="h-full">
			<CountriesListNavigation />
			<div>
				<h1>Countries List</h1>
			</div>
		</div>
	);
}
